import React from 'react';
import './ContactUs.css';
import Modal from '../Modal/Modal';

class ContactUs extends React.Component{
    state = {
        _modalOpen: false
    }
    render(){
        return (
            <div className='contact_cont'>
                <button className='btn btn-white'>
                    CONTACT US
                </button>
                <Modal/>
            </div>
        )
    }
}

export default ContactUs;
